} The constant table constants is a Vec containing the Value type, and the bytecode sequence byte_codes is a Vec containing the ByteCode type. They are both Vec structures with the same functionality but different containment types. In the ancient C language, to include the two types Value and ByteCode, either write a set of codes for each type, or use complex features such as macros or function pointers. Generics in the Rust language can abstract the same set of logic for different types. More features of generics will be used in subsequent code. After defining ParseProto, let's look at the syntax analysis process. We currently only support the statement of print "hello, world!", which is the format of Name String. The Name is first read from the lexer, followed by the string constant. If it is not in this format, an error will be reported. The specific code is as follows: pub fn load(input: File) -> ParseProto { let mut constants = Vec::new(); let mut byte_codes = Vec::new(); let mut lex = Lex::new(input); loop { match lex.next() { Token::Name(name) => { // `Name LiteralString` as function call constants.push(Value::String(name)); byte_codes.push(ByteCode::GetGlobal(0, (constants.len()-1) as u8)); if let Token::String(s) = lex.next() { constants.push(Value::String(s)); byte_codes.push(ByteCode::LoadConst(1, (constants.len()-1) as u8)); byte_codes.push(ByteCode::Call(0, 1)); } else { panic!("expected string"); } } Token::Eos => break, t => panic!("unexpected token: {t:?}"), } } dbg!(&constants); dbg!(&byte_codes); ParseProto { constants, byte_codes }
} The input is the source file File, and the output is the ParseProto just defined. The main body of the function is a loop, and the Token is cyclically read through the next() function provided by the lexical analyzer lex created at the beginning of the function. We currently only support one type of statement, Name LiteralString, and the semantics are function calls. So the analysis logic is also very simple: When Name is encountered, it is considered to be the beginning of a statement: Use Name as a global variable and store it in the constant table; Generate GetGlobal bytecode, load the global variable on the stack according to the name. The first parameter is the index of the target stack. Since we currently only support the function call statement, the stack is only used for function calls, so the function must be at position 0; the second parameter is the index of the global variable name in the global variable; Read the next Token, and it is expected to be a string constant, otherwise panic; Add string constants to the constant table; Generate LoadConst bytecode to load constants onto the stack. The first parameter is the target stack index, which is behind the function and is 1; the second parameter is the index of the constant in the constant table; Once the function and parameters are ready, Call bytecode can be generated to call the function. At present, the two parameters are the function position and the number of parameters, which are fixed at 0 and 1 respectively. When Eos is encountered, exit the loop. When encountering other Tokens (currently only of Token::String type), panic. After the function, the constant table and bytecode sequence are output through dbg! for debugging. It can be compared with the output of luac. Finally returns ParseProto.

